infections urinaires : une cuillère à café de graines noires ou ¼ de cuiller d’huile avec du miel cru ou de manuka (remplacer le miel par autre
    chose pour les chats) 2 fois par jour digestion on confère à la nigelle des vertus détoxifiantes, digestives, diurétiques et carminatives, et elle pourrait aider à combattre autant la constipation que la diarrhée
    (donc un modulateur du transit intestinal), la gastro-entérite, et les hémorroïdes ;

