c'est un répulsif efficace les poux, les puces, les acariens, les fourmis, les
    moustiques (dont ceux porteurs du ver de cœur), les phlébotomes porteurs de la leishmaniose (dilution a 2% dans de l’huile de moutarde ou de noix de coco), et certaines espèces de tiques ;
    la tique brune du chien serait apparemment assez résistante aux vertus répulsives de l'huile de neem, ce qui ne veut pas dire qu'elle n’aura aucun effet.
